import React from 'react';

import './styles.css'

import Header from '../Header'
import Section from '../Section'
import Services from '../Se'

function Layout() {
    return (
        <div className="containerLayout">
            <Header />
            <Section />
            <Services />
        </div>
    )
}

export default Layout;
